import React, { useEffect, useState } from 'react';

function App() {
  const [htmlContent, setHtmlContent] = useState("");

  useEffect(() => {
    fetch('/')
      .then((res) => res.text())
      .then((data) => setHtmlContent(data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <div dangerouslySetInnerHTML={{ __html: htmlContent }} />
  );
}

export default App;
